export default function getCityWeatherData(e) {
    console.log("hi");
    console.log(e.currentTarget.parentNode.parentNode.children);
    for (let i = 0; i < 3; i++) {
        if (e.currentTarget.parentNode == e.currentTarget.parentNode.parentNode.children[i]) {
            console.log("found it", i);
        }
    }
}
